        <p>{`Current Date is - ${currentDate}`}</p>,
        <p>{`Current Time is - ${currentTime}`}</p>,

        <div className='img-div'>
        <img src={img1} alt='random pic'/>
        <img src={img2} alt='random pic'/>
        <a href={links} target="_blank">
        <img src={img3} alt='random pic'/>
        </a>
        </div>

